//App.js
import React from 'react';
import { Provider } from 'react-redux';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { store, persistor } from './Redux/store';
import Header from './Components/HomeScreen/Header';
import HomeScreen from './Container/Home';
import News from './Container/News';
import Search from './Container/Search';
import Article from './Container/Article';
import SearchResult from './Container/SearchResult';
import Gallery from './Container/Gallery';
import BasicSearch from './Container/BasicSearchMain/BasicSearch';
import AdvancedSearch from './Container/AdvancedSearchMain/AdvancedSearch';
import TraditionalSearch from './Container/TraditionalSearchBar';
import ShapePage from './Container/AdvancedSearchMain/ShapePage';
import InventoryPage from './Container/AdvancedSearchMain/InventoryPage';
import ProveniencePage from './Container/AdvancedSearchMain/ProveniencePage';
import VaseSearchResult from './Container/BasicSearchMain/VaseSearchResult';
import ArtifactDetail from './Container/ArtifactDetail';
function App() {
  return (
    <Provider store={store}>
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<HomeScreen />} />
            <Route path="/news" element={<News />} />
            <Route path="/search-tool" element={<Search />} />
            <Route path="/article" element={<Article />} />
            <Route path="/search" element={<SearchResult />} />
            <Route path="/gallery" element={<Gallery />} />
            <Route path="/basic-search" element={<BasicSearch />} />
            <Route path="/advanced-search" element={<AdvancedSearch />} />
            <Route path="/traditional-search" element={<TraditionalSearch />} />
            <Route path="/search-by-shape" element={<ShapePage />} />
            <Route path="/search-by-inventory" element={<InventoryPage />} />
            <Route path="/search-by-provenience" element={<ProveniencePage />} />
            <Route path="/search-by-shape/testSearch.asp" element={<VaseSearchResult/>} />
            <Route path="/search-by-inventory/testSearch.asp" element={<VaseSearchResult/>} />
            <Route path="/search-by-provenience/testSearch.asp" element={<VaseSearchResult/>} />
            <Route path="/vase-detail/:referenceNo" element={<ArtifactDetail/>} />
          </Routes>
        </div>
      </Router>
    </Provider>
  );
}

export default App;
